import { HStack, Heading, Image, Text, VStack } from "@chakra-ui/react";
import { TomotimeHeader } from "../Components/Header";

export default function Home() {
  return (
    <VStack mt={20}>
      <TomotimeHeader />

      <VStack mt={10}>
        <Heading fontFamily="display" fontWeight="black">
          Selfie Snake
        </Heading>
        <Text size="md">Create your selfie snake!</Text>
      </VStack>
    </VStack>
  );
}
